import React from 'react';

const CompTime = () => {
  return (
    <div className='now'>
      <time>
        {2023} - 
        {12} - 
        {25} 
        
        </time>
      <time>{2023} - {12} - {25}</time>
    </div>
  );
};

export default CompTime;
